   338→
   339→        <p>The <b>Edinburgh Institute for Temporal Studies</b> (<b>EITS</b>) is a private research institute based in <a href="/wiki/Edinburgh">Edinburgh</a>, Scotland, dedicated to the study of <a href="chronolinguistics.html">chronolinguistics</a>, <a href="semantic-stratigraphy.html">semantic stratigraphy</a>, and related fields exploring the relationship between language, meaning, and time. Founded in 2019 by Dr. Fiona MacLeod and Dr. Helena Voss, the Institute has become the world's leading center for research into phenomena such as <a href="temporal-debt.html">temporal debt</a>, <a href="lexical-half-life.html">lexical half-life</a>, and <a href="semantic-drift.html">semantic drift</a>.<sup><a href="#cite1">[1]</a></sup></p>
   340→
   341→        <p>The Institute is particularly known for developing <a href="temporal-linguistics-engineering.html">temporal linguistics engineering</a> (TLE), the applied discipline of deliberately intervening in language evolution to shape future meanings. It also operates the world's only network of <b>Semantic Weather Stations</b>, monitoring installations that track meaning change in real-time across multiple language communities.<sup><a href="#cite2">[2]</a></sup></p>
